script: |
  super -f text -I q3352.spq | sort > q3352.out

inputs:
  - name: q3352.spq
    data: |
      SELECT DISTINCT COUNT ( * ) + + + 13 + - + 91 AS col2 FROM tab1 (FORMAT parquet) WHERE + 18 BETWEEN - col0 AND ( - - 11 + col1 );
  - name: tab1

outputs:
  - name: q3352.out
    data: |
      -76
